import React  from 'react';
import { Container, Row, Col, Carousel, Button } from 'react-bootstrap';
import {
    Header,
    Footer,
    BasicSlider,
    ScrollButton,
} from '../../components';
import {
    settings,
    slides,
} from './Data_old';
import {
    cyclope_eye,
    play_icon,
    arrow_right,
    bg_blue,
    bg_blue2,
    bg_red,
    dote_poster1,
    dote_poster2,
    hantu_poster1,
    hantu_poster2,
    kid_poster1,
    kid_poster2,
    productaion_banner,
    sep_poster1,
    sep_poster2,
    sep_poster3,
    sep_poster4,
    video_thumbnail1,
    video_thumbnail2,
    video_thumbnail3,
} from '../../assets/images';



function InProduction() {



    return (
        <>
            <Header />
 
            <Footer />
            <ScrollButton />
            
        </>
    );
}

export default InProduction;
